const express = require("express");
const app = express();
const body = require("body-parser");

app.use(body.urlencoded({extended: true}));
app.set('view engine', 'ejs');

// data
let myMovie = [
    {title: "MoMo-Land", image: "data:image/jpeg;base64,"}
,   {title: "Twice", image: "data:image/jpeg;base64,"}
,   {title: "Irene", image: "data:image/jpeg;base64,"}
];
// end of data

app.get("/", function(req, res) {
    res.render('welcome');
});

app.get("/movieground", function(req, res) {
    res.render("movieGround", {myMovie:myMovie});
});

app.post("/movieground", function(req, res) {
    // this will handle for the post
    // it will append the obj to the array
    // it will redirect to get movieground
    let title = req.body.title;
    let image = req.body.image;
    let newMovieObj = {
        title: title
    ,   image: image
    };
    myMovie.push(newMovieObj);
    res.redirect("/movieground");
});

app.get("/movieground/new", function(req, res) {
    res.render("newMovie");
});

app.listen(3000, function() {
    console.log("My App Started");
});